webpackJsonp([0xf1f4aa6157db],{2734:function(a,l){a.exports={pathContext:{docHtml:'<h1>is-callable <sup><a href="https://npmjs.org/package/is-callable"><img src="http://versionbadg.es/ljharb/is-callable.svg" alt="Version Badge"></a></sup></h1>\n<p><a href="https://travis-ci.org/ljharb/is-callable"><img src="https://travis-ci.org/ljharb/is-callable.svg" alt="Build Status"></a>\n<a href="https://david-dm.org/ljharb/is-callable"><img src="https://david-dm.org/ljharb/is-callable.svg" alt="dependency status"></a>\n<a href="https://david-dm.org/ljharb/is-callable#info=devDependencies"><img src="https://david-dm.org/ljharb/is-callable/dev-status.svg" alt="dev dependency status"></a>\n<a href="LICENSE"><img src="http://img.shields.io/npm/l/is-callable.svg" alt="License"></a>\n<a href="http://npm-stat.com/charts.html?package=is-callable"><img src="http://img.shields.io/npm/dm/is-callable.svg" alt="Downloads"></a></p>\n<p><a href="https://npmjs.org/package/is-callable"><img src="https://nodei.co/npm/is-callable.png?downloads=true&#x26;stars=true" alt="npm badge"></a></p>\n<p><a href="https://ci.testling.com/ljharb/is-callable"><img src="https://ci.testling.com/ljharb/is-callable.png" alt="browser support"></a></p>\n<p>Is this JS value callable? Works with Functions and GeneratorFunctions, despite ES6 @@toStringTag.</p>\n<h2>Example</h2>\n<pre><code class="language-js">var isCallable = require(\'is-callable\');\nvar assert = require(\'assert\');\n\nassert.notOk(isCallable(undefined));\nassert.notOk(isCallable(null));\nassert.notOk(isCallable(false));\nassert.notOk(isCallable(true));\nassert.notOk(isCallable([]));\nassert.notOk(isCallable({}));\nassert.notOk(isCallable(/a/g));\nassert.notOk(isCallable(new RegExp(\'a\', \'g\')));\nassert.notOk(isCallable(new Date()));\nassert.notOk(isCallable(42));\nassert.notOk(isCallable(NaN));\nassert.notOk(isCallable(Infinity));\nassert.notOk(isCallable(new Number(42)));\nassert.notOk(isCallable(\'foo\'));\nassert.notOk(isCallable(Object(\'foo\')));\n\nassert.ok(isCallable(function () {}));\nassert.ok(isCallable(function* () {}));\nassert.ok(isCallable(x => x * x));\n</code></pre>\n<h2>Tests</h2>\n<p>Simply clone the repo, <code>npm install</code>, and run <code>npm test</code></p>',docPath:"argo-ci/node_modules/is-callable/readme",proj:"argo-ci"}}}});
